//Import Pakage
import React, {StrictMode} from "react";

//Import Components
import { StrongSubTitle, StrongTextImportant, StrongTextTitle } from "../../components";

//Import style
import '../../style/Docs.css';

const HomePage = ()=>{
    return(
        <StrictMode>
            <section className="container-md p-3">
                <div className="container-xl container-main-header">
                    <div className="main-header-img"></div>
                    <h2 className="main-header-title title-Allstudy">Allstudy</h2>
                </div>
                
                <section className="container-md p-3">
                    <h2>¿Qué es {<StrongSubTitle content="Allstudy"/>}?</h2>
                    <p className="container-md p-2">
                        <StrongSubTitle content={"Allstudy"}/>
                    </p>
                </section>
            </section>
        </StrictMode>
    )
}

export {
    HomePage
}
